window.bookSummaryJSON = "<p><b>Magic is twisted, and chaos reigns in this climactic final novel in the Crescent City trilogy by award-winning author Kristen Painter.</b></p> <p>New Orleans is on the brink of war.</p> <p>Harlow is a ghost in her own body. She has no control, no power - all she can do is watch as her twin sister, Ava Mae, lives recklessly and foolishly, slowly destroying everything Harlow has worked so hard for.</p> <p>Augustine needs to focus on his new role as Guardian of New Orleans, as tourists mysteriously disappear off the streets, but all he can think of is rescuing Harlow - keeping his family safe. </p> <p>As the Coven grows more powerful, control of the city hangs in the balance, and if the witches prevail, no fae will survive.</p>"; 
